_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"972106","type":"CustomJS"},{"attributes":{"overlay":{"id":"971973"}},"id":"971968","type":"BoxZoomTool"},{"attributes":{"fill_color":{"field":"returns_positive","transform":{"id":"971748"}},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"971939","type":"Scatter"},{"attributes":{},"id":"971772","type":"UndoTool"},{"attributes":{"active_drag":{"id":"971729"},"active_scroll":{"id":"971730"},"tools":[{"id":"971729"},{"id":"971730"},{"id":"971731"},{"id":"971732"},{"id":"971733"},{"id":"971734"},{"id":"971735"},{"id":"972104"},{"id":"972107"}]},"id":"971737","type":"Toolbar"},{"attributes":{"line_color":"#1f77b4","line_width":1.5,"x":{"field":"index"},"y":{"field":"equity"}},"id":"971793","type":"Line"},{"attributes":{"source":{"id":"971746"}},"id":"971937","type":"CDSView"},{"attributes":{"overlay":{"id":"971736"}},"id":"971731","type":"BoxZoomTool"},{"attributes":{},"id":"971959","type":"BasicTicker"},{"attributes":{},"id":"971820","type":"Selection"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"971776","type":"BoxAnnotation"},{"attributes":{},
